<body>
    <div id="Container" style="display:none">
      <canvas id="GameCanvas" oncontextmenu="event.preventDefault()" tabindex="0"></canvas>
    </div>

    <div id ="LoadingBannerBackground">
    </div>

  
<script src="./vconsole.min.js"></script>
<script type="text/javascript">
    // open web debugger console
    window.VConsole && (window.vConsole = new VConsole());
</script>

<!-- Polyfills bundle. -->
<script src="src/polyfills.bundle.js" charset="utf-8"> </script>

<!-- SystemJS support. -->
<script src="src/system.bundle.js" charset="utf-8"> </script>

<!-- Import map -->
<script src="src/import-map.json" type="systemjs-importmap" charset="utf-8"> </script>

<script>
    System.import('./index.js').catch(function(err) { console.error(err); })
</script>

  <!-- SystemJS support. -->
  <script>
    window.OnHideLoading = function () {
      document.getElementById("LoadingBannerBackground").style.display = "none";
      document.getElementById("LoadingBannerBackground").remove();
      document.getElementById("Container").style.display = "block";
    }

    window.CloseGame = function() {
      if(window.MaxApi) {
        window.MaxApi.dismiss();
      } else {
        const event = new CustomEvent("BackKeyPressed", {});
        window.dispatchEvent(event);
      }
    }

    window.SetRatioForLowDevice = function() {
      if(window.MaxApi) {
        window.MaxApi.getDeviceInfo((res) => {
          if(res.devicePerformance == "low-end")
          {
            console.log("LOW DEVICE");
            window.devicePixelRatio = 1.5;
          }
        });
      }
    }

    window.realtimeSinceStartup = Date.now();
    // window.SetRatioForLowDevice();
  </script>
</body>
